import React, { useState } from "react";
import { Link } from "react-router-dom";

function Navbar() {
  const [isOpen, setIsOpen] = useState(false);

  const toggleMenu = () => setIsOpen(!isOpen);

  return (
    <nav style={styles.navbar}>
      {/* Left side: Logo */}
      <div style={styles.left}>
        <div style={styles.logo}>
          <Link to="/" style={styles.logoLink}>QuizApp</Link>
        </div>
      </div>

      {/* Hamburger button for mobile */}
      <div style={styles.hamburger} onClick={toggleMenu}>
        <div style={styles.bar}></div>
        <div style={styles.bar}></div>
        <div style={styles.bar}></div>
      </div>

      {/* Menu items */}
      <div style={{ ...styles.menu, display: isOpen ? "flex" : "none" }}>
        <ul style={styles.navLinks}>
          <li><Link to="/" style={styles.link} onClick={() => setIsOpen(false)}>Dashboard</Link></li>
          <li><Link to="/profile" style={styles.link} onClick={() => setIsOpen(false)}>Profile</Link></li>
          <li><Link to="/settings" style={styles.link} onClick={() => setIsOpen(false)}>Settings</Link></li>
          <li><Link to="/past-quizzes" style={styles.link} onClick={() => setIsOpen(false)}>Past Quizzes</Link></li>
          <li><Link to="/upcoming-quizzes" style={styles.link} onClick={() => setIsOpen(false)}>Upcoming Quizzes</Link></li>
        </ul>
        <div style={styles.right}>
          <Link to="/login" style={{ ...styles.button, marginRight: "10px" }} onClick={() => setIsOpen(false)}>Login</Link>
          <Link to="/signup" style={styles.button} onClick={() => setIsOpen(false)}>Signup</Link>
        </div>
      </div>
    </nav>
  );
}

const styles = {
  navbar: {
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    padding: "10px 20px",
    backgroundColor: "blue", // Make sure this is visible
    color: "#fff",
    fontFamily: "Arial, sans-serif",
    position: "relative",
  },
  left: {
    display: "flex",
    alignItems: "center",
  },
  logo: {
    fontSize: "20px",
    fontWeight: "bold",
  },
  logoLink: {
    textDecoration: "none",
    color: "#fff",
  },
  hamburger: {
    display: "none", // hidden on desktop
    flexDirection: "column",
    cursor: "pointer",
    gap: "4px",
  },
  bar: {
    width: "25px",
    height: "3px",
    backgroundColor: "#fff",
  },
  menu: {
    display: "flex",
    flexDirection: "row",
    alignItems: "center",
    gap: "20px",
  },
  navLinks: {
    listStyle: "none",
    display: "flex",
    gap: "20px",
    margin: 0,
    padding: 0,
    flexDirection: "row",
  },
  link: {
    textDecoration: "none",
    color: "#fff",
    fontWeight: "bold",
  },
  right: {
    display: "flex",
    alignItems: "center",
  },
  button: {
    padding: "8px 15px",
    borderRadius: "5px",
    textDecoration: "none",
    backgroundColor: "#fff",
    color: "#4CAF50",
    fontWeight: "bold",
  },
  // Media queries for responsiveness
  '@media (max-width: 768px)': {
    hamburger: {
      display: "flex",
    },
    menu: {
      flexDirection: "column",
      position: "absolute",
      top: "60px",
      left: 0,
      width: "100%",
      backgroundColor: "#4CAF50",
      padding: "10px 0",
    },
    navLinks: {
      flexDirection: "column",
      gap: "10px",
      alignItems: "center",
    },
    right: {
      flexDirection: "column",
      gap: "10px",
      alignItems: "center",
      marginTop: "10px",
    },
  },
};

export default Navbar;
